import React from 'react';
import logo from './logo.svg';
import './App.css';
import PermanentDrawerLeft from './drawer';

function App() {
  return (
    <div>
      <script type="text/javascript" src="https://www.dropbox.com/static/api/2/dropins.js" id="dropboxjs" data-app-key="z5p9y3pr6ufqsbh" onLoad={console.log("loading")}></script>
      {PermanentDrawerLeft()}
    </div>
  );
}

export default App;
